DECLARE @t TABLE (
	[ID] [int] NOT NULL,
	[FAM] [nvarchar](50) NULL,
	[IM] [nvarchar](50) NULL,
	[OT] [nvarchar](50) NULL,
	[Room] [nvarchar](50) NULL,
