	[PODR_ID] [nvarchar](8) NULL,
	[OTD_ID] [nvarchar](20) NULL,
	[PRVS_ID] [int] NULL,
	[PROFIL_ID] [int] NULL,
	[DET_ID] [int] NULL,
	[VID_POM_ID] [int] NULL,
	[FIO]  AS ((([FAM]+' ')+case when [IM] IS NULL then '' else substring([IM],(1),(1))+'. ' end)+case when [OT] IS NULL then '' else substring([OT],(1),(1))+'.' end),
	[NameWithID]  AS ((((CONVERT([char](6),[id],(0))+[FAM])+' ')+case when [IM] IS NULL then '' else substring([IM],(1),(1))+'. ' end)+case when [OT] IS NULL then '' else substring([OT],(1),(1))+'.' end),
	[SNILS] [varchar](14) NULL,
	[IsInSchedule] [bit] NOT NULL,
	[isReestrUpload] [bit] NOT NULL
)
