SELECT 
(SELECT pd.NameWithID
   FROM PodrDb AS pd WHERE pd.Id = dso.LPU_1), dso.IDDOKT, dso2.[YEAR], 
   (SELECT NameWithID FROM @t WHERE SNILS = dso.IDDOKT)doc,
    COUNT(*)
FROM D3_ZSL_OMS AS dzo
JOIN D3_SL_OMS AS dso ON dso.D3_ZSLID = dzo.ID
JOIN D3_PACIENT_OMS AS dpo ON dpo.ID = dzo.D3_PID
JOIN D3_SCHET_OMS AS dso2 ON dso2.ID = dzo.D3_SCID --AND dso2.NSCHET LIKE '%сдан%'
LEFT JOIN Yamed_Spr_MedicalEmployee AS ysme ON ysme.SNILS = dso.IDDOKT

WHERE dzo.USL_OK = 3 AND dso.LPU_1 LIKE '%460013%'
AND dso2.[YEAR] IN (2020, 2021, 2022)
AND dso2.CODE_MO = 460013
GROUP BY dso.LPU_1, dso2.[YEAR], dso.IDDOKT